abstract class Interpolatable {
    static protected  int interpolate(double val, double[] arr) {
        if (val < 0) {
            throw new IllegalArgumentException("Negative value not allowed");
        } else if (val > 0 && val < arr[0]) {
            return 0;
        } else if (val > arr[arr.length - 1]) {
            return arr.length - 1;
        } else {
            for (int i = 0; i < arr.length; i++) {
                if (arr[i] <= val && val <= arr[i + 1]) {
                    return i;
                }
            }

        }
        throw new IllegalArgumentException("Something bad happening");
    }

}

