    private static final double[] pressure = {
            10.0, 20, 30, 40, 50, 60, 70, 80, 90, 100, 110, 120, 130, 140
    };
    public static double get(double w,double pres) throws OutOfRangeException{
        if (pres > 180){
            throw new IllegalArgumentException("Pressure must be less than 180 atm.");
        }
        if (pres<1){
            throw new IllegalArgumentException("Pressure must be more than 1 atm.");
        }
        if (w<0){
            throw new IllegalArgumentException("Velocity must be positive value.");
        }
        int bottomFirst = interpolate(pres,pressure);
        int upperFirst = bottomFirst == pressure.length-1?bottomFirst:bottomFirst+1;
        double[][] botArr =  c[bottomFirst];
        double[][] upArr =  c[upperFirst];
        double botC = botArr[1][interpolate(w,botArr[0])];
        double upC = upArr[1][interpolate(w,upArr[0])];
        return (upperFirst==bottomFirst)?botC:botC+((pressure[upperFirst]-pres)/(pressure[upperFirst]-pressure[bottomFirst]))*(upC-botC);
    }
    @Test
    @DisplayName("Phi testing")
    public void test(){
        assertEquals(0.0,Phi.get(0,0), "Zero Case");
        assertEquals(0.0,Phi.get(0,300), "Zero velocity case");
        assertEquals(0.0,Phi.get(300,0), "Zero pressure case");

    }


